  const items = ["Apple", "Banana", "Orange", "Grape", "Mango", "Pineapple"];

  return (
    <div>
      <Counter />;
      <Name />;
      <ProductList />;
      <div>
        <h1>Search Filter Example</h1>
        <SearchFilter items={items} />
      </div>
    </div>
  );
}

export default App;
